webpackJsonp([25539104500848],{3203:function(e,t){e.exports={data:{markdownRemark:{html:'<p><img src="http://thg.danmaq.com/image/ss/thG_02_s.jpg" alt="Click to see the details."></p>\n<p>It <em>is a semi-action RPG using the view of the world of</em> the <em>East which</em> was created for technical verification rather than for coterie.</p>\n<p>It is not like actions like tales clearly saying clearly ARPG, but it is not a battle form RPG that behaves like a FF but thinks like a command / turn system, it is not a battle form of RPG (I\'m sorry about chicken bastards that can not be played properly in active mode ) It is half action RPG.</p>\n<p>The hero is the original character ...... or the player himself. The familiar heroines appeared as residents of the township and will not cooperate with us. Because they are always fickle. Gensokyo is at least a very peaceful thing at the moment.</p>\n<ul>\n<li>Genre: RPG</li>\n<li>Language used: Visual C ++. Net 2003</li>\n<li><a href="http://thg.danmaq.com/">Go to thG (temporary name) special page</a></li>\n<li>Currently making semi-frozen</li>\n</ul>',frontmatter:{cover:null,date:"2008-02-01T00:00:00+09:00",strDate:"2008/1/31",title:"thG (tentative name)"}}},pathContext:{path:"/en/blog/2008/02/01-thg%e4%bb%ae%e7%a7%b0/",langKey:"en"}}}});
